import React from 'react';
import '../../../../App.css';

const day = (props) => {
    let imgSrc = props.setImg(props.weather);
    console.log(props.weather);
        return (
            <div className="cardCustom dayCard" 
                onClick={props.click}>

                <h2 className="">{props.day}</h2>
                <p class="date">{props.date}</p>

                <div className="row justify-content-center">
                    <div className="col-3 align-self-center">
                        <img src={imgSrc} alt={props.weather} className="images"/>
                    </div>
                    <div className="information col-7">
                        <p>Brzina vjetra: {props.windSpeed}km/h</p>
                        <p>Vlažnost vazduha: {props.humidity}%</p>
                    </div>
                </div>

                <div className="row">
                <div className="col">
                    <p>Maksimalna dnevna temperatura: {props.maxDayTemp}<sup>C</sup></p>
                    <p>Minimalna dnevna temperatura: {props.minDayTemp}<sup>C</sup></p>
                    </div>
                    <div className="col">    
                    <p>Maksimalna noćna temperatura: {props.maxNightTemp}<sup>C</sup></p>
                    <p>Maksimalna noćna temperatura: {props.minNightTemp}<sup>C</sup></p>
                    </div>
                </div>
               
            </div>

        );
}

export default day;
